import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <TitleWrapper>
                <Title>Hi Kate!</Title>
            </TitleWrapper>
            <YellowStripe></YellowStripe>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: pink;
    display: flex;
    align-items: center;
    flex-direction: column;

`;

const Title = styled.h1`

    color: white;
    font-size: 96px;
`;

const  TitleWrapper = styled.div`
    display: flex;
    border-radius: 10%;
    border: 2px solid white;
`;

const YellowStripe = styled.div`
    background: yellow;
    width: 100%;
    height: 20%;
`;

export default KatePage;
